import React from 'react';

export default function About() {
    return (
        <div>
            <h1>ABOUT</h1>
            <p>A passionated developer that aims to make beautiful yet usefull products. I'm quietly confident, naturally curious, and perpetually working on improving my chops one design problem at a time.</p>
        </div>
    );
}
